import React from "react";
import img2 from "./Homeimg/automation_projects.jpg";
import "./Homeimg2.css";
function Homeimg2() {
  return (
    <div>
      <img src={img2} alt="" className="home-sub-img2" />
      <h4 className="home-sub-head1">Automation</h4>
    </div>
  );
}
export default Homeimg2;
